export const initialState = { mainPosts: [{
  id:1,
    year: {
    id: 1,
      nickname:'제로초,'
    },
    content: '첫 번째 게시글 #해시태그 #익스프레스'
  }] };

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
